import { Box, Typography } from '@mui/material'
import React from 'react'

const Rightbar = () => {
  return (
    <Box  flex={2} p={2} >
      <Box position="fixed">
        <Typography variant></Typography>
      </Box>
    </Box>
  )
}

export default Rightbar
